import logo from './images/logo.svg';
import menu from './images/icons8-menu.svg';

const Navbar = () => {
    return (
        <nav className='w-10/12 mx-auto py-10 flex justify-between'>
            <img 
            className='h-8'
            src={logo} 
            alt="logo"/>
            <div className=' text-center bg-darkViolet text-white absolute w-10/12 mx-auto top-24 font-bold'>
                <div className=' border-b border-gray w-4/5 mx-auto py-4'>
                    <p className='py-4'>Features</p>
                    <p className='py-2'>Pricing</p>
                    <p className='py-4'>Resources</p>
                </div>
                <div className=''>
                    <p className='pt-8'>Login</p>
                    <button className='py-4 bg-cYan w-4/5 '>Sign Up</button>
                </div>
            </div>
            <img 
            className='h-8'
            src={menu} 
            alt="navbar"/>
        </nav>
    );
}

export default Navbar;
